INSERT INTO `chat_messages` VALUES (62,33,37,33,7,'2018-11-08 14:32:44','Hi. How are you?',NULL,1,1),(63,33,37,33,7,'2018-11-08 14:32:55','There’s something I need to talk to you about. ',NULL,1,1),(64,33,37,37,7,'2018-11-08 14:34:44','I’m fine, thank you.',NULL,1,1),(65,33,37,37,7,'2018-11-08 14:35:15','Are there any problems?',NULL,1,1),(67,33,37,33,7,'2018-11-08 14:36:43','Could you think about lowering the rent?',NULL,1,1),(68,33,37,37,7,'2018-11-08 15:10:15','Well, if you have a hard time, we can agree to half of the price for 6 months. ',NULL,1,1),(69,33,37,37,7,'2018-11-08 15:11:45','What do you say?',NULL,1,1),(70,33,37,33,7,'2018-11-08 16:02:45','That’s very generous of you. Thank you!',NULL,1,1),(71,33,37,37,7,'2018-11-08 16:03:10','See you next month, then',NULL,1,1),(72,33,37,33,7,'2018-11-08 16:04:45','See ya. Bye.',NULL,1,1),(73,33,39,33,8,'2018-10-02 07:51:06','Good morning. Do you have a minute?',NULL,1,1),(74,33,39,39,8,'2018-10-02 07:53:35','Hi. Of course, what can I do for you?',NULL,1,1),(75,33,39,33,8,'2018-10-02 07:55:11','I\'m thinking of renovating, Let me know what you think. ',NULL,1,1),(76,33,39,39,8,'2018-10-02 08:10:34','I don’t see why not. We can talk about it  tomorrow at the usual place?',NULL,1,1),(77,33,39,33,8,'2018-10-02 08:11:02','Can we set up another meeting place?',NULL,1,1),(78,33,39,39,8,'2018-10-02 08:12:15','Yes, let’s meet in the neighborhood, then.',NULL,1,1),(79,33,39,33,8,'2018-10-02 08:14:26','That’s great. I appreciate it.',NULL,1,1),(80,33,39,39,8,'2018-10-02 08:15:41','See you tomorrow. Bye.',NULL,1,1),(81,33,39,33,8,'2018-10-02 08:16:09','Bye.',NULL,1,0);
