INSERT INTO `template_messages` VALUES (53,'Sorry I\'m running late, but I\'m on my way. ','Normal'),(54,'I\'m afraid I\'ll be late, but I\'ll be there.','Formal'),(55,'Are there any problems?','Normal'),(56,'Please feel free to contact me if there are any problems.','Formal'),(57,'I completely agree with you about that.','Normal'),(58,'I\'m happy to say that we agree on this issue.','Formal'),(59,'How do You feel about switching the payment method?','Normal'),(60,'Would it be possible to change the payment method?','Formal'),(61,'I\'m thinking of renovating, let me know what you think. ','Normal'),(62,'I would like to ask you if I could have the place renovated?','Formal'),(63,'Can we please postpone the meeting, something came up? ','Normal'),(64,'Could we please reschedule the meeting, something urgent came up?','Formal'),(65,'Could you think about changing the rent price?','Normal'),(66,'I would appreciate it if you consider changing the rent price. ','Formal'),(67,'Can we set up another meeting place?','Normal'),(68,'Would you mind changing the location of the meeting, please?','Formal'),(69,'I really need to see you about habitability problems. ','Normal'),(70,'Unfortunately, habitability issues occurred in the rental unit.','Formal'),(71,'I\'m out of town. I\'ll reach out to you as soon as possible. ','Normal'),(72,'I\'d like to inform you I\'m out of town, but I\'ll contact you later.','Formal'),(73,'Sorry I missed your call, I\'ll get back to you later.','Normal'),(74,'I apologize for missing your call. Expect a reply as soon as possible.','Formal');
